import React from 'react';

const CollectionPreview = ({ title, items }) => (
	<div>
		<h1>{title.toUpperCase()}</h1>
		<div>{items.filter((item, idx) => idx < 4).map((item) => <div>{item.name}</div>)}</div>
	</div>
);
export default CollectionPreview;
